          "message": "Add TLS settings support to OpAMP Supervisor config (#23848)\n\nThis can be tested by using for example the following supervisor config:\r\n```yaml\r\nserver:\r\n  endpoint: wss://127.0.0.1:4320/v1/opamp\r\n  tls:\r\n    insecure_skip_verify: true\r\n```\r\n\r\nRun the supervisor against the example server that we have here and\r\nwhich requires TLS connections from clients:\r\n\r\nhttps://github.com/open-telemetry/opamp-go/tree/main/internal/examples/server",
